import { TreeView as BaseTreeView, } from "@microsoft/fast-components-react-base";
import treeViewSchema from "./tree-view.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { TreeViewStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const TreeView = manageJss(TreeViewStyles)(BaseTreeView);
export { TreeView, treeViewSchema, };
